import React from 'react';
import './App.css';
import { Route, Switch } from 'react-router-dom';
import Nav from './components/nav/nav';

function App() {
  return (
    <div className="App">
    <Switch>
    <Route path='/' component={Nav}></Route>
    </Switch>

      <h1>Primer Componente</h1>
    </div>
  );
}

export default App;
